import ProductList from "./ProductList";
// import { useEffect } from "react";
import { connect } from 'react-redux';
import { isFetchingCreactor, setNftData } from '../../redux/productPageReducer.tsx';
import React from "react";

class ProductListContainer extends React.Component {

    componentDidMount() {
        this.props.isFetchingCreactor(true);
        fetch('http://localhost:8000/Products/', {method: 'GET'})
            .then(response => response.json())
            .then(data => {
                this.props.setNftData(data)
                this.props.isFetchingCreactor(true)
            })
    }

    render() {
        return (
            <ProductList nft={this.props.nft} productPage={this.props.productPage} />
        )
    }
}

const mapDispatchToProps = {
    isFetchingCreactor, setNftData
}

const mapStateToProps = (state) => {
    return {
        nft: state.productPage.nft,
        productPage: state.productPage
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(ProductListContainer);
